import React from "react";

import { Card } from "primereact/card";

import { HomeMenu } from "../components/home-menu";

class HomeView extends React.Component {
  render() {
    const link =
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fes.123rf.com%2Fphoto_8935136_conjunto-de-tres-antiguos-cuadros-vac%25C3%25ADos-de-la-polaroid-acostado-en-una-superficie-de-madera-.html&psig=AOvVaw2hfVu58wPSajgsG2-E_hz1&ust=1594095147684000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJiChrDht-oCFQAAAAAdAAAAABAg";
    return (
      <div className="home-view">
        <HomeMenu />
        <Card title="Fandesign">
          <span>Content</span>
          <img src={link} />
        </Card>
      </div>
    );
  }
}

export default HomeView;
